import React from "react";
import Robot from "../unit/Robot";
import { useSelector } from "react-redux";

export default function RobotGrid() {
  function addToCart(robot) {
    console.log("add cart event");
  }
  const robots = useSelector((state) => state.counter);
  return (
    <div className="row">
      {robots.map((robot, index) => {
        return <Robot key={index} robot={robot} addToCart={addToCart}></Robot>;
      })}
    </div>
  );
}
